import React, { Component } from 'react'
import PropTypes from 'prop-types'
import { connect } from 'react-redux'
import { logoutUser } from '../../actions/authActions'

class Menu extends Component {
  onLogoutClick = (e) => {
    e.preventDefault()
    this.props.logoutUser()
  }

  render() {
    return (
      <div>
        <Link to="/menu">
          <h1>Menu</h1>
        </Link>
        <Link to="/camera">
          <h1>Camera</h1>
        </Link>
      </div>
    )
  }
}
